import React, { Component } from 'react';
import { Table, Divider, Modal, Button, Input, Select } from 'antd';

export default class indentList extends Component {
    state = {
        name: '',
    };
    render() {
        return (
            <div>
                <Input
                    value={this.state.name}
                    placeholder="用户名"
                    onChange={e =>
                        this.setState({
                            name: e.target.value.trim(),
                        })
                    }
                />
            </div>
        );
    }
}
